import React from "react";

import { Link } from "react-router-dom";
// import { ListItem } from "../components/List";
const style = {
div: {
        backgroundColor: "blue",
 borderRadius: 50,
 display: "inline-block", 
 width:100
},
    
image: {
    borderRadius: "100%",
    height: 100
}
};

// The ...props means, spread all of the passed props onto this element
// That way we don't have to define them all individually
function Cards_paths(props) {
    return (

        <div style={style.div} key={props.path.id}>
            <Link to={"/paths/" + props.path.id}>
                <h2>
                    {props.path.name}
                </h2>
                <p>
                    {props.path.description}
                </p>
                <img src={props.path.image} alt={props.path.name} style={style.image }></img>
            </Link>
        </div>
    );
}

export default Cards_paths;
